import React from 'react';
import logo from './logo.png';
import './App.css';

class App extends React.Component{
      render(){
        // const bar ={
        //     backgroundColor:"orange",
        //     padding:"100px",
        //             };
        return (
    <div className="App">
      <header className="App-header">

        <a
        className="name"
        >PRINCETON<br></br>PLASMA PHYSICS<br></br>LABRATORY
        </a>
        <img src={logo} className="App-logo" alt="logo" />
        <div className="box"></div>
        <a className="words"> A Collaborative National Center for Fusion & Plasma Research</a>
        {/*<div className="text">*/}
          <a className="head"> Analytical toy model for <br></br> the Kadomtsev Sawtooth</a>
          <a className="authors"> Chris Smiet & Ralf Mackenbach<br></br>Princeton Plasma Physics Labratory</a>
          <a className="abstract"> Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract
          Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract Chris & Ralf to write their own abstract</a>
          <a className="title"> I. Introduction</a><a className="magazine">Chris & Ralf introduction. Chris & Ralf introduction Chris & Ralf hhhhh introduction Chris & Ralf introduction
           Chris & Ralf introduction Chris & Ralf introduction. Chris & Ralf introduction Chris & Ralf introduction Chris & Ralf introduction Chris & Ralf introduction
           Chris & Ralf introduction Chris & Ralf introduction. Chris & Ralf introduction Chris & Ralf introduction Chris & Ralf introduction Chris & Ralf introduction</a>

        {/*<p>
          Edit <code>src/App.js</code> and save to reload.
        </p>*/}
        {/*</div>*/}
        {/*<a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>*/}
      </header>

    <table className="main" >
      <thead>
        <tr> 
          <th><b>Parameter</b></th>
          <th><b>Symbol</b></th> 
          <th><b>Value(s)</b></th> 
          <th><b>Unit(s)</b></th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>...</td>
          <td>...</td>
          <td>...</td>
          <td>...</td>
        </tr>
        <tr>
          <td>...</td>
          <td>...</td>
          <td>...</td>
          <td>...</td>
        </tr>
        <tr>
          <td>...</td>
          <td>...</td>
          <td>...</td>
          <td>...</td>
        </tr>
        <tr>
          <td>...</td>
          <td>...</td>
          <td>...</td>
          <td>...</td>
        </tr>
      </tbody>
    </table>
    </div>

  );

      }
}

